import React from 'react';
import { FaUser, FaCart, FaHeart } from 'react-icons/fa' 

const RightIcons = () => {
  return (
    <div className='right-icons'>
      <div className='icons'>
        <FaUser />
      </div>
      <div className='icons'>
        <FaCart />
      </div>
      <div className='icons'>
        <FaHeart />
      </div>
    </div>
  );
}

export default RightIcons;
